// src/Components/Review/Review.jsx (Conceptual Code - you will need to implement this)

import React, { useState, useEffect } from 'react';
import './Review.css'; // Make sure you have this CSS file

function Review({ fileName, fileType, detectedPii, onProceed, onCancel }) {
  // State to manage the 'ignore' checkboxes
  const [reviewItems, setReviewItems] = useState([]);

  useEffect(() => {
    // Initialize reviewItems from detectedPii, adding an 'ignore' flag
    if (detectedPii) {
      setReviewItems(detectedPii.map(item => ({ ...item, ignore: item.ignore || false })));
    }
  }, [detectedPii]);

  const handleIgnoreChange = (index) => {
    setReviewItems(prevItems =>
      prevItems.map((item, i) =>
        i === index ? { ...item, ignore: !item.ignore } : item
      )
    );
  };

  const handleProceedClick = () => {
    // Pass the updated review items back to the parent (App.jsx)
    onProceed(reviewItems);
  };

  const handleCancelClick = () => {
    onCancel();
  };

  return (
    <div className="modal-overlay">
      <div className="review-modal-content">
        <div className="modal-header">
          <h2>Review Before Anonymization</h2>
          <button className="close-button" onClick={handleCancelClick}>&times;</button>
        </div>
        <div className="modal-body">
          <p>File: {fileName} (Type: {fileType})</p>

          {reviewItems.length === 0 ? (
            <p className="no-pii-message">No PII detected for this file, or data not available for review.</p>
          ) : (
            <div className="review-table-container">
              <table>
                <thead>
                  <tr>
                    {/* Conditional Headers based on fileType */}
                    {fileType === 'Text file' && <th>Word</th>}
                    {fileType === 'Tabular file' && <th>Column</th>}
                    <th>Entity</th>
                    <th>PII Confidence</th>
                    <th>Ignore</th>
                  </tr>
                </thead>
                <tbody>
                  {reviewItems.map((item, index) => (
                    <tr key={index}>
                      {/* Conditional Data Cells based on fileType */}
                      {fileType === 'Text file' && <td>{item.word}</td>}
                      {fileType === 'Tabular file' && (
                        <td>
                          <strong>{item.column}</strong>
                          {item.topData && item.topData.length > 0 && (
                            <div className="top-data-preview">
                              {/* Display top 2 data examples */}
                              {item.topData.slice(0, 2).map((data, i) => (
                                <span key={i} className="data-item">{data}</span>
                              ))}
                              {item.topData.length > 2 && <span className="data-item">...</span>}
                            </div>
                          )}
                        </td>
                      )}
                      <td>{item.detect}</td>
                      <td>
                        <span className="confidence-badge" style={{ backgroundColor: item.confidence >= 70 ? '#4CAF50' : '#FFC107' }}>
                          {Math.round(item.confidence)}% {/* Display as 0-100% */}
                        </span>
                      </td>
                      <td>
                        <input
                          type="checkbox"
                          checked={item.ignore}
                          onChange={() => handleIgnoreChange(index)}
                        />
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          )}
          <p className="note-message">Note: Those below 70% automatically marked as ignore (NONE_PII).</p>
        </div>
        <div className="modal-footer">
          <button className="proceed-button" onClick={handleProceedClick}>Proceed</button>
        </div>
      </div>
    </div>
  );
}

export default Review;
